@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_60 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :combined_t_cell_and_b_cell_immunodeficiency ;
    :has_definition "A combined T cell and B cell immunodeficiency characterized by variably decreased immunoglobulin production, decreased T-regulatory cells, overall impaired lymphocyte maturation, inflammatory bowel disease and recurrent sinopulmonary infections that has_material_basis_in heterozygous mutation in the BACH2 gene on chromosome 6q15." ;
    :has_exact_synonym "BACH2-related immunodeficiency and autoimmunity",
        "BRIDA",
        "IMD60" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_27a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by high circulating levels of IFNG, failure of cellular responses to IFNG, and early and often fatal mycobacterial infections that has_material_basis_in homozygous or compound heterozygous mutation in the IFNGR1 gene on chromosome 6q23.3." ;
    :has_exact_synonym "IMD27A",
        "autosomal recessive IFNGR1 deficiency",
        "autosomal recessive MSMD due to partial IFNgammaR1 deficiency",
        "autosomal recessive MSMD due to partial interferon gamma receptor 1 deficiency",
        "autosomal recessive immunodeficiency 27A, mycobacteriosis",
        "autosomal recessive mendelian susceptibility to mycobacterial diseases due to partial IFNgammaR1 deficiency",
        "autosomal recessive mendelian susceptibility to mycobacterial diseases due to partial interferon gamma receptor 1 deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_27b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by residual cellular responses to IFNG in vitro and recurrent, moderately severe infections with environmental mycobacteria or bacillus Calmette-Guerin that has_material_basis_in heterozygous mutation in the IFNGR1 gene on chromosome 6q23.3." ;
    :has_exact_synonym "IMD27B",
        "autosomal dominant IFNGR1 deficiency",
        "autosomal dominant MSMD due to partial IFNgammaR1 deficiency",
        "autosomal dominant MSMD due to partial interferon gamma receptor 1 deficiency",
        "autosomal dominant immunodeficiency 27B, mycobacteriosis",
        "autosomal dominant mendelian susceptibility to mycobacterial diseases due to partial IFNgammaR1 deficiency",
        "autosomal dominant mendelian susceptibility to mycobacterial diseases due to partial interferon gamma receptor 1 deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_11a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :severe_combined_immunodeficiency ;
    :has_definition "A severe combined immunodeficiency characterized by defective intracellular signaling in T and B cells, increased numbers of transitional B cells, hypogammaglobulinemia, decreased numbers of regulatory T cells and defects in T-cell function that has_material_basis_in homozygous or compound heterozygous mutation in the CARD11 gene on chromosome 7p22.2." ;
    :has_exact_synonym "CARD11 deficiency",
        "IMD11A",
        "SCID due to CARD11 deficiency",
        "severe combined immunodeficiency due to CARD11 deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_11b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :t_cell_deficiency ;
    :has_definition "A T cell deficiency characterized by defects in T-cell activation, increased IgE, eosinophilia and early childhood onset of moderate to severe atopic dermatitis that has_material_basis_in heterozygous mutation in the CARD11 gene on chromosome 7p22.2." ;
    :has_exact_synonym "IMD11B",
        "atopic dermatitis, elevated IgE, and eosinophilia",
        "immunodeficiency 11B with atopic dermatitis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_15b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :severe_combined_immunodeficiency ;
    :has_definition "A severe combined immunodeficiency characterized by onset in infancy of life-threatening bacterial, fungal, and viral infections, failure to thrive, impaired differentiation and activation of immune cells, and hypo- or agammaglobulinemia but relatively normal B and T cell numbers that has_material_basis_in homozygous or compound heterozygous mutation in the IKBKB gene on chromosome 8p11.21." ;
    :has_exact_synonym "IMD15B" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_15a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :combined_t_cell_and_b_cell_immunodeficiency ;
    :has_definition "A combined T cell and B cell immunodeficiency characterized by immune dysregulation, combined T and B cell deficiency, inflammation, and epithelial defects that has_material_basis_in heterozygous missense mutation in the IKBKB gene on chromosome 8p11.21." ;
    :has_exact_synonym "IMD15A" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_26 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :severe_combined_immunodeficiency ;
    :has_definition "A severe combined immunodeficiency characterized by virtually absent peripheral B and T cells but normal numbers of NK cells, complete block in B-cell differentiation, and a defect in slow repair of DNA double-strand breaks in fibroblasts, that has_material_basis_in homozygous or compound heterozygous mutation in the PRKDC gene on chromosome 8q11.21." ;
    :has_exact_synonym "IMD26",
        "SCID due to DNA-PKcs deficiency",
        "immunodeficiency 26, with or without neurologic abnormalities",
        "severe combined immunodeficiency due to DNA-PKcs deficiency" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:combined_immunodeficiency rdfs:subClassOf :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease that involves multiple components of the immune system." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dendritic_cell_deficiency rdfs:subClassOf :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by impaired function or reduced numbers of dendritic cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:b_cell_and_dendritic_cell_deficiency rdfs:subClassOf :combined_immunodeficiency ;
    :has_definition "A combined immunodeficiency characterized by impaired function or reduced numbers of dendritic cells and B cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:t_cell_b_cell_and_nk_cell_deficiency rdfs:subClassOf :combined_immunodeficiency ;
    :has_definition "A combined immunodeficiency characterized by impaired function or reduced numbers of T cells, B cells, and natural killer (NK) cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:monocyte_dendritic_cell_and_nk_cell_deficiency rdfs:subClassOf :combined_immunodeficiency ;
    :has_definition "A combined immunodeficiency characterized by impaired function or reduced numbers of monocytes, dendritic cells, and natural killer (NK) cells." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_54 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :nk_cell_deficiency ;
    :has_definition "An NK cell deficiency characterized by severe intra- and extrauterine growth retardation, microcephaly, decreased numbers of CD56(dim) natural killer cells, adrenal insufficiency, and recurrent viral infections that has_material_basis_in homozygous or compound heterozygous mutation in the MCM4 gene on chromosome 8q11.21." ;
    :has_exact_synonym "IMD54",
        "NKCD",
        "familial isolated natural killer cell deficiency",
        "primary immunodeficiency due to MCM4 deficiency",
        "primary immunodeficiency with natural-killer cell deficiency and adrenal insufficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_41 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :combined_immunodeficiency ;
    :has_definition "A combined immunodeficiency characterized by a defect in T cell regulation with proliferation of CD8+ T cells, impaired antibody specific responses, and elevated cytokines resulting in recurrent viral, fungal, and bacterial infections, lymphadenopathy, and variable autoimmune features that has_material_basis_in homozygous or compound heterozygous mutation in the IL2RA gene on chromosome 10p15.1." ;
    :has_exact_synonym "CD25 deficiency",
        "IL2RA deficiency",
        "IMD41",
        "immunodeficiency 41 with lymphoproliferation and autoimmunity",
        "immunodeficiency due to CD25 deficiency",
        "interleukin-2 receptor alpha chain deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_39 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by impaired interferon I and III production in response to influenza virus infection that has_material_basis_in homozygous or compond heterozygous mutation in the IRF7 gene on chromosome 11p15.5." ;
    :has_exact_synonym "IMD39" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_10 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :t_cell_and_nk_cell_immunodeficiency ;
    :has_definition "A T cell and NK cell immunodeficiency characterized by onset in childhood of recurrent infections due to defective T- and NK-cell function that has_material_basis_in homozygous mutation in the STIM1 gene on chromosome 11p15.4." ;
    :has_exact_synonym "CID due to STIM1 deficiency",
        "IMD10",
        "STIM1 deficiency",
        "combined immunodeficiency due to STIM1 deficiency",
        "immune dysfunction with T-cell inactivation due to calcium entry defect 2" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_18 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by onset in infancy or early childhood of recurrent infections with variable severity that has_material_basis_in homozygous or compound heterozygous mutation in the CD3E gene on chromosome 11q23.3." ;
    :has_exact_synonym "CD3-epsilon deficiency",
        "IMD18" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_19 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :severe_combined_immunodeficiency ;
    :has_definition "A severe combined immunodeficiency characterized by onset in early infancy of recurrent bacterial, viral, and fungal infections with a T cell-negative, B cell-positive, natural killer cell-positive immune cell phenotype that has_material_basis_in homozygous or compound heterozygous mutation in the CD3D gene on chromosome 11q23.3." ;
    :has_exact_synonym "CD3-delta deficiency",
        "IMD19",
        "SCID T cell-negative, B cell-positive, NK cell-positive",
        "severe combined immunodeficiency, T cell-negative, B cell-positive, NK cell-positive" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_17 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :t_cell_deficiency ;
    :has_definition "A T cell deficiency characterized by partial T-cell lymphopenia with normal numbers of B and NK cells and highly variable clincal severity that has_material_basis_in homozygous or compound heterozygous mutation in the CD3G gene on chromosome 11q23.3." ;
    :has_exact_synonym "CD3-gamma deficiency",
        "IMD17",
        "SCID-like immunodeficiency, T cell-partial, B cell-positive, NK cell-positive",
        "immunodeficiency 17, CD3 gamma deficient" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_59 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :b_cell_and_dendritic_cell_deficiency ;
    :has_definition "A B cell and dendritic cell deficiency characterized by granulocytopenia, B-cell and dentritic cell deficiency, recurrent septic infections of the respiratory tract, skin, and mucous membranes, and stress-induced hypoglycemia that has_material_basis_in homozygous or compound heterozygous mutation in the HYOU1 gene on chromosome 11q23.3." ;
    :has_exact_synonym "IMD59",
        "granulocytopenia with immunoglobin abnormality",
        "immunodeficiency 59 and hypoglycemia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_44 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by increased susceptibility to viral infections and adverse multisystemic reaction to vaccination with apparent defects in mitochondrial fission and fusion that has_material_basis_in homozygous or compound heterozygous mutation in the STAT2 gene on chromosome 12q13.3." ;
    :has_exact_synonym "IMD44" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_9 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :t_cell_deficiency ;
    :has_definition "A T cell deficiency characterized by early onset of recurrent infections due to defective T-cell activation, ectodermal dysplasia, and congenital myopathy that has_material_basis_in homozygous or compound heterozygous mutation in the ORAI1 gene, which encodes a subunit of the plasma membrane calcium channel CRAC, on chromosome 12q24.31." ;
    :has_exact_synonym "CID due to ORAI1 deficiency",
        "IMD9",
        "combined immunodeficiency due to ORAI1 deficiency",
        "immune dysfunction with T-cell inactivation due to calcium entry defect 1" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_7 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :t_cell_deficiency ;
    :has_definition "A T cell deficiency characterized by decreased or absent CD3+ T cells with TCR-alpha/beta expression, immune dysregulation, recurrent infections, and failure to thrive that has_material_basis_in homozygous or compound heterozygous mutation in the TRAC gene on chromosome 14q11.2." ;
    :has_exact_synonym "IMD7",
        "TCR-alpha-beta-positive T-cell deficiency",
        "immunodeficiency 7, TCR-alpha/beta deficient" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_65 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by onset in early infancy of recurrent and severe viral infections, impaired cellular type I interferon response, and poor outcomes after vaccination with live attenuated vaccines that has_material_basis_in homozygous or compound heterozygous mutation in the IRF9 gene on chromosome 14q12." ;
    :has_exact_synonym "IMD65",
        "immunodeficiency 65, susceptibility to viral infections" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_49 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :t_cell_deficiency ;
    :has_definition "A T cell deficiency characterized by T cell lymphopenia, low T-cell receptor excision circles, impaired T-cell proliferative responses, dysmorphic facial features, hypotonia and severe global developmental delay that has_material_basis_in heterozygous mutation in the BCL11B gene on chromosome 14q32.2." ;
    :has_exact_synonym "IMD49",
        "SCID, T-cell negative, B-cell positive, NK cell positive, with intellectual disability, spasticity, and craniofacial abnormalities",
        "severe combined immunodeficiency, T-cell negative, B-cell positive, NK cell positive, with intellectual disability, spasticity, and craniofacial abnormalities" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_64 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :t_cell_b_cell_and_nk_cell_deficiency ;
    :has_definition "A T cell, B cell, and NK cell deficiency characterized by variably decreased numbers of T cells, lesser deficiencies of B and NK cells, decreased phosphorylation of the extracellular-signal-regulated serine kinase ERK in T and B cells, and onset in early childhood of recurrent bacterial, viral, and fungal infections that has_material_basis_in homozygous or compound heterozygous mutation in the RASGRP1 gene on chromosome 15q14." ;
    :has_exact_synonym "IMD64" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_43 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by recurrent infections, reduced serum concentrations of immunoglobulin G and albumin due to rapid degradation of these proteins, abnormal renal or liver function, and excessive gastrointestinal protein that has_material_basis_in homozygous or compound heterozygous mutation in B2M on chromosome 15q21.1." ;
    :has_exact_synonym "B2M deficiency",
        "IMD43",
        "beta-2-microglobulin deficiency",
        "hypercatabolic hypoproteinemia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_56 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :combined_t_cell_and_b_cell_immunodeficiency ;
    :has_definition "A combined T cell and B cell immunodeficiency characterized by B- and T-cell defects including defective class-switched B cells, low IgG, defective antibody response, and defective T-cell responses to certain antigens, and variable dysfunction of NK cells that has_material_basis_in homozygous or compound heterozygous mutation in the IL21R gene on chromosome 16p12.1." ;
    :has_exact_synonym "IL21R immunodeficiency",
        "IMD56",
        "combined immunodeficiency due to IL21R deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_52 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :t_cell_deficiency ;
    :has_definition "A T cell deficiency characterized by onset of severe recurrent infections in infancy and a defect in T-cell receptor signaling resulting in variable immunological disorders that has_material_basis_in homozygous or compound heterozygous mutation in LAT on chromosome 16p11.2." ;
    :has_exact_synonym "IMD52",
        "severe combined immunodeficiency due to LAT deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_58 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :combined_t_cell_and_b_cell_immunodeficiency ;
    :has_definition "A combined T cell and B cell immunodeficiency characterized by defective T-cell function with decreased Treg cells and deficient CD3/CD28 costimulation responses in both CD4+ and CD8+ T cells, variable impairment in B-cell function, early-onset skin lesions, recurrent respiratory infections or allergies, and chronic persistent infections that has_material_basis_in homozygous or compound heterozygous mutation in the CARMIL2 gene on chromosome 16q22.1." ;
    :has_exact_synonym "IMD58",
        "severe combined immunodeficiency due to CARMIL2 deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_32b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :monocyte_dendritic_cell_and_nk_cell_deficiency ;
    :has_definition "A monocyte, dendritic cell, and NK cell deficiency characterized by defects in monocyte, dendritic cell, and natural killer (NK) cell development or function resulting recurrent infections particularly viral nfections that has_material_basis_in homozygous or compound heterozygous mutation in the IRF8 gene on chromosome 16q24.1." ;
    :has_exact_synonym "IMD32B",
        "autosomal recessive IRF8 deficiency",
        "immunodeficiency 32B, monocyte and dendritic cell deficiency, autosomal recessive" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_32a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :dendritic_cell_deficiency ;
    :has_definition "A dendritic cell deficiency characterized by marked loss of CD11C-positive/CD1C dendritic cells and increased susceptibility to mycobacterial infections that has_material_basis_in heterozygous mutation in the IRF8 gene on chromosome 16q24.1." ;
    :has_exact_synonym "IMD32A",
        "MSMD due to partial IRF8 deficiency",
        "MSMD due to partial interferon regulatory factor 8 deficiency",
        "Mendelian susceptibility to mycobacterial diseases due to partial IRF8 deficiency",
        "Mendelian susceptibility to mycobacterial diseases due to partial interferon regulatory factor 8 deficiency",
        "immunodeficiency 32A, mycobacteriosis, autosomal dominant" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_13 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :t_cell_deficiency ;
    :has_definition "A T cell deficiency characterized by decreased CD4 T-lymphocyte counts that has_material_basis_in heterozygous mutation in the UNC119 gene on chromosome 17q11.2." ;
    :has_exact_synonym "ICL",
        "IMD13",
        "idiopathic CD4 lymphopenia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_12 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
