    :has_exact_synonym "Pork tapeworm infection"@en,
        "Tapeworm infection intestinal taenia solum"@en,
        "Tapeworm infection pork"@en,
        "intestinal taenia solium infection"@en,
        "neurocysticercosis"@en,
        "tenia solium infectious disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
