                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :breast ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :brain ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :renal_system ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :disease_has_location ;
                                                    owl:someValuesFrom :internal_ear ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :disease_has_location ;
                                                            owl:someValuesFrom :lung ] ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :disease_has_location ;
                                                                    owl:someValuesFrom :pleural_cavity ] ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :disease_has_location ;
                                                                            owl:someValuesFrom :orbital_cavity ] ;
                                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                    owl:onProperty :disease_has_location ;
                                                                                    owl:someValuesFrom :superficial_fascia ] ;
                                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                            owl:onProperty :disease_has_location ;
                                                                                            owl:someValuesFrom :abdominal_viscera ] ;
                                                                                    rdf:rest :nil ] ] ] ] ] ] ] ] ] ],
        :brain_disease,
        :breast_disease,
        :inner_ear_disease,
        :lung_disease,
        :parasitic_helminthiasis_infectious_disease,
        :urinary_system_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection by the genus Spirometra. A painful nodule develops after the plerocercoid larvae migrate to the brain causing cerebral sparganosis. Subcutaneous tissue, breast, orbit, urinary tract, pleural cavity, lungs, abdominal viscera and inner ear can be infected." ;
    :has_exact_match "MESH:D013031" ;
    :has_exact_synonym "Infection by Sparganum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
