            owl:someValuesFrom :ataxia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :sleep_disturbance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :sensory_disturbance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        :trypanosomiasis ;
    :has_definition "A trypanosomiasis that results from infection by Trypanosoma brucei and gambiense, which is transmitted by the bite of an infected tsetse fly (Glossina spp). The symptoms include fever, headache, joint pain, itching, confusion, sensory disturbances, poor coordination and sleep disturbances." ;
    :has_exact_synonym "African sleeping sickness"@en,
        "African trypanosomiasis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trypanosomiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trypanosoma ],
        :parasitic_protozoa_infectious_disease ;
    :has_definition "A parasitic protozoa infectious disease that involves infection caused by parasitic protozoan of the genus Trypanosoma in animals and humans." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperpigmentation_of_eyelid rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eyelid ],
        :eyelid_disease,
        :pigmentation_disease ;
    :has_definition "An eyelid disease that is characterized by dark eyelids." ;
    :has_exact_synonym "dark eyelids",
        "dyspigmentation of eyelid"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pigmentation_disease rdfs:subClassOf :skin_disease ;
    :has_definition "A skin disease that is characterized by discoloration of the skin." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:corneal_disease rdfs:subClassOf :eye_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cornea ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An eye disease that affects the cornea, which is the transparent surface of the eye that assists in light refraction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_hydrops_keratoconus rdfs:subClassOf :keratoconus ;
    :has_definition "A keratoconus that is characterized by stromal edema due to leakage of aqueous humor through a tear in Descemet's membrane." ;
    :has_exact_synonym "Keratoconus, acute hydrops"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:keratoconus rdfs:subClassOf :corneal_disease ;
    :has_definition "A corneal disease characterized by structural changes within the cornea causing it to thin and change, leading to a protruding conical shape." ;
    :has_exact_synonym "conical cornea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebral_artery_occlusion rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebrum ],
        :cerebrovascular_disease ;
    :has_definition "A cerebrovascular disease that is characterized by blockage in one or more of the cerebral arteries." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:venous_insufficiency rdfs:subClassOf :vein_disease ;
    :has_definition "A vein disease that is characterized by impaired flow of blood through the veins." ;
    :has_exact_synonym "peripheral venous insufficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:psychologic_vaginismus rdfs:subClassOf :psychosexual_disorder ;
    :has_definition "A psychosexual disorder that is characterized by involuntary spasm of the outer muscles of the vagina during penetration that results from a psychological cause." ;
    :has_exact_synonym "Functional vaginismus"@en,
        "Non-organic vaginismus"@en,
        "Psychogenic Vaginismus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:psychosexual_disorder rdfs:subClassOf :sexual_health_disorder ;
    :has_definition "A sexual disorder that is characterized as a sexual problem that is psychological, rather than physiological in origin." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:xerophthalmia rdfs:subClassOf :dry_eye_syndrome ;
    :has_definition "A dry eye syndrome that is characterized by conjunctival and corneal xerosis, Bitot's spots, keratomalacia, nyctalopia, and retinopathy resulting from vitamin A deficiency." ;
    :has_exact_synonym "Conjunctival xerosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:conjunctival_degeneration rdfs:subClassOf :conjunctival_disease,
        :eye_degenerative_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :eye_degenerative_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :conjunctiva ] ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dry_eye_syndrome rdfs:subClassOf :lacrimal_apparatus_disease ;
    :has_definition "A lacrimal apparatus disease that is characterized by persistent irritation or burning of the coreneal surface." ;
    :has_exact_match "MESH:D015352" ;
    :has_exact_synonym "dry eye disease",
        "Tear film insufficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thymus_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte ],
        :lymphoma,
        :thymus_cancer ;
    :has_definition "A thymus cancer that arises from the thymus." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:long_bones_of_lower_limb_cancer rdfs:subClassOf :bone_cancer ;
    :has_definition "A bone cancer that is manifested in the long bones of the lower limb." ;
    :has_exact_synonym "malignant neoplasm of long bones of leg"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_neoplasm_of_short_bones_of_lower_limb rdfs:subClassOf :bone_cancer ;
    :has_definition "A bone cancer that is located in the short bones of lower limbs." ;
    :has_exact_synonym "malignant neoplasm of short bone of lower limb"@en,
        "malignant neoplasm of short bones of leg"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meckel_s_diverticulum_cancer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :ileum ],
        :ileum_cancer ;
    :has_definition "An ileum cancer originating from Meckel's diverticulum." ;
    :has_exact_synonym "Meckel diverticulum cancer"@en,
        "malignant neoplasm of Meckel's diverticulum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ileum_cancer rdfs:subClassOf :small_intestine_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :ileum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A small intestine cancer that is located_in the ileum." ;
    :has_exact_synonym "ileal neoplasm"@en,
        "malignant neoplasm of ileum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:small_intestine_cancer rdfs:subClassOf :intestinal_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :small_intestine ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An intestinal cancer that is located_in the small intestine." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intestinal_cancer rdfs:subClassOf :gastrointestinal_system_cancer,
        :intestinal_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :intestine ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A gastrointestinal system cancer that is located_in the intestine." ;
    :has_exact_synonym "malignant intestinal tumors"@en,
        "malignant neoplasm of intestine"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:benign_ileal_neoplasm rdfs:subClassOf :small_intestine_benign_neoplasm ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :ileum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A small intestine benign neoplasm that affects the wall of the ileum." ;
    :has_exact_synonym "Ileal tumor"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:osteonecrosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :necrosis ],
        :ischemic_bone_disease ;
    :has_definition "An ischemic bone disease that results_in necrosis located_in bone." ;
    :has_exact_synonym "Avascular necrosis of bone"@en,
        "aseptic necrosis"@en,
        "bone necrosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lacrimal_passage_granuloma rdfs:subClassOf :lacrimal_apparatus_disease ;
    :has_exact_synonym "Granuloma of lacrimal passages"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:optic_papillitis rdfs:subClassOf :optic_neuritis ;
    :has_definition "An optic neuritis that is characterized by hyperemia, blurring of the disk margins, microhemorrhages, blind spot enlargement, and engorgement of retinal veins resulting in swelling around the optic disc." ;
    :has_exact_synonym "papillitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neuroretinitis rdfs:subClassOf :eye_disease ;
    :has_definition "An eye disease that is characterized by inflammation of the retina." ;
    :has_exact_synonym "Focal retinitis and retinochoroiditis, juxtapapillary"@en,
        "Juxtapapillary focal retinitis AND retinochoroiditis"@en,
        "Papilloretinitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_hypertensive_renal_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :kidney ],
        :renal_hypertension .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

