            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :bronchial_benign_neoplasm,
        :lipoma ;
    :has_definition "A lipoma that is located within the lumen of a bronchus." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spindle_cell_lipoma rdfs:subClassOf :lipoma ;
    :has_definition "A lipoma that is an asymptomatic, slow-growing subcutaneous tumor that has a predilection for the posterior back, neck, and shoulders of older men." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophageal_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :esophagus ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :esophageal_disease,
        :gastrointestinal_system_benign_neoplasm,
        :lipoma ;
    :has_definition "A lipoma located in the esophagus." ;
    :has_exact_synonym "Lipoma of esophagus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skin_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :lipoma,
        :skin_benign_neoplasm ;
    :has_definition "A skin benign neoplasm that derives_from fat cells." ;
    :has_exact_synonym "Cutaneous Lipoma"@en,
        "Lipoma of skin"@en,
        "cutaneous lipomatous tumor"@en,
        "lipoma of face"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:osteomyelitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :fungi ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :bacteria ],
        :bacterial_infectious_disease,
        :bone_inflammation_disease,
        :fungal_infectious_disease ;
    :has_definition "A bone inflammation disease that has_material_basis_in infection located_in bone or located_in bone marrow." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liver_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :lipoma,
        :liver_benign_neoplasm ;
    :has_definition "A lipoma located in the liver." ;
    :has_exact_synonym "hepatic lipoma",
        "Lipoma of the Liver"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pleomorphic_lipoma rdfs:subClassOf :lipoma ;
    :has_definition "A lipoma that is characterized by floret giant cells with overlapping nuclei." .
